import Item from '../components/Item';

const Layout = styled.div`
  display: flex;
`;

const Home = () => {
  return (
    <Layout>
      <h1>Grocery Calculator</h1>
      <form>
        <label>
          Total (including tax): $
          <input type='text' name='name' />
        </label>
        <label>
          Tax: $
          <input type='text' name='name' />
        </label>
        <input type='submit' value='Submit' />

        <h2>Sawyer Deductions</h2>
        <p>enter prices of items to be removed from Sawyer's total</p>
        <Item price={3.75} />
      </form>
    </Layout>
  );
};

export default Home;
